import React from "react";

function Sum(a,b){
    let number1 = 40
    let number2 = 4
    let sum = number1 + number2
    return sum
}

function Sub(a,b){
    let n1 = 30
    let n2 = 3
    let sub = n1 +n2
    return sub
}

function Div(a,b){
    let div = div1 + div2
    return div
}

function Mult(a,b){
    let mult = a * b
    return mult
}

export default Sum;
export {Sub, Div, Mult};
